import React, {Component} from 'react';
import Table from './Table';
import './App.css';

class App extends Component {
  state = {
    characters: [
    ],
  }

  render() {
    const characters = [
      {
        name: 'Charlie',
        job: 'Janitor',
      },
      {
        name: 'Mac',
        job: 'Bouncer',
      },
      {
        name: 'Dee',
        job: 'Aspring actress',
      },
      {
        name: 'Dennis',
        job: 'Bartender',
      },
    ]

    return (
      <div className="container">
        <Table characterData = {characters} />
      </div>
    )
  }
}

export default App;
